import React from 'react';
import logo from '../assets/logo.svg';
const NavBar = () => {
    return (
        <div>
            <nav>
                <ul>
                    <li>Home</li>
                    <li>Feature</li>
                    <li>Blog</li>
                    <li></li>
                </ul>
            </nav>
            <img src={logo} alt="logo" />
            <div>
                <button>Login</button>
                <button>Sign Up</button>
            </div>
        </div>
    );
};

export default NavBar;
